import React, { useContext, useEffect, useState } from "react";
import { observer } from "mobx-react-lite";
import { Context } from "../../index";
import { Pagination } from "@mui/material";

import "./Pages.css";
import { getServices } from "../../http/serviceAPI";

const Pages = observer(() => {
  const { service } = useContext(Context);
  const [page, setPage] = useState(1);
  const pageCount = Math.ceil(service.totalService / service.limit);

  useEffect(() => {
    getServices(page).then((data) => {
      service.setServices(data.rows);
      service.setTotalService(data.count);
    });
  }, [service, page]);

  return (
    <Pagination
      color='primary'
      count={pageCount}
      page={page}
      onClick={(_, num) => setPage(num)}
    />
  );
});

export default Pages;
